  `status` smallint(6) DEFAULT NULL COMMENT '状态 101-未标注 103-自动标注中 104-自动标注完成 105-完成',
  `patient_id` varchar(50) DEFAULT NULL COMMENT '检查号(CT号或CR、DR号)',
  `study_instance_uid` varchar(64) DEFAULT NULL COMMENT '研究实例UID',
  `series_instance_uid` varchar(64) DEFAULT NULL COMMENT '序列实例UID',
  `modality` varchar(50) DEFAULT NULL COMMENT '模式',
  `body_part_examined` varchar(50) DEFAULT NULL COMMENT '部位',
  `merge_annotation` text COMMENT '自动标注内容合并后结果',
  `remark` varchar(255) DEFAULT NULL,
  `origin_user_id` bigint(20) NOT NULL COMMENT '资源拥有人',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型 0: private 私有数据,  1:team  团队数据  2:public 公开数据',
  `annotate_type` smallint(6) NOT NULL DEFAULT '0' COMMENT '标注类型: 1.器官分割 2.病灶检测之肺结节检测',
  `stop` bit(1) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='医学数据集';

/*Data for the table `data_medicine` */

/*Table structure for table `data_medicine_file` */

DROP TABLE IF EXISTS `data_medicine_file`;

CREATE TABLE `data_medicine_file` (
  `id` bigint(20) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_user_id` bigint(20) DEFAULT NULL COMMENT '更新用户ID',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '0-正常 1-已删除',
  `medicine_id` bigint(20) DEFAULT NULL COMMENT '数据集ID',
  `name` varchar(225) DEFAULT NULL COMMENT '文件名称',
  `url` varchar(255) DEFAULT NULL COMMENT '文件地址',
  `instance_number` smallint(6) DEFAULT NULL COMMENT '实例序号',
  `sop_instance_uid` varchar(64) DEFAULT NULL COMMENT 'SOP实例UID',
  `origin_user_id` bigint(20) DEFAULT NULL COMMENT '资源拥有人',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态 101-未标注 103-自动标注完成 104-完成',
  `image_position_patient` double(11,1) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='医学数据集';

/*Data for the table `data_medicine_file` */

/*Table structure for table `data_sequence` */

DROP TABLE IF EXISTS `data_sequence`;

CREATE TABLE `data_sequence` (
  `id` int(11) NOT NULL,
  `business_code` varchar(50) NOT NULL,
  `start` int(11) NOT NULL,
  `step` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `business_code_unique` (`business_code`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='自定义获取主键ID表';

/*Data for the table `data_sequence` */


/*Table structure for table `data_task` */

DROP TABLE IF EXISTS `data_task`;

CREATE TABLE `data_task` (
  `id` bigint(20) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `total` int(11) NOT NULL DEFAULT '0' COMMENT '任务需要处理的文件总数',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '任务状态 0.待分配 1.分配中 2.进行中 3.已完成 4.失败',
  `finished` int(11) NOT NULL DEFAULT '0' COMMENT '已完成的文件数',
  `failed` int(11) NOT NULL DEFAULT '0' COMMENT '失败文件数量',
  `files` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '文件id数组',
  `dataset_id` bigint(20) DEFAULT NULL COMMENT '数据集ID',
  `annotate_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '标注类型：0分类,1目标检测',
  `data_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '数据类型:0图片，1视频',
  `labels` text CHARACTER SET utf8 NOT NULL COMMENT '该自动标注任务使用的标签数组，json串形式',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '0正常，1已删除',
  `datasets` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '数据集id数组',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `type` smallint(6) DEFAULT NULL COMMENT '任务类型 0.自动标注 1.ofrecord 2.imageNet 3.数据增强 4.目标跟踪 5.视频采样',
  `dataset_version_id` bigint(20) DEFAULT NULL COMMENT '数据集版本ID',
  `enhance_type` text CHARACTER SET utf8 COMMENT '增强类型数组',
  `url` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '视频文件url',
  `frame_interval` int(11) DEFAULT NULL COMMENT '视频帧间隔',
  `merge_column` varchar(255) DEFAULT NULL COMMENT 'csv合并列',
  `version_name` varchar(255) DEFAULT NULL COMMENT '转预置版本号',
  `target_id` bigint(20) DEFAULT NULL COMMENT '目标数据集id',
  `model_service_id` bigint(20) DEFAULT NULL COMMENT '模型服务id',
  `file_type` smallint(6) DEFAULT NULL COMMENT '待处理文件类型 0-全部 304-无标注 303-有标注',
  `stop` bit(1) DEFAULT NULL COMMENT '是否停止 0-没有 1-已停止',
  `of_record_version` varchar(255) DEFAULT NULL COMMENT '生成ofRecord的版本号',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `deleted` (`deleted`) USING BTREE,
  KEY `ds_status` (`datasets`,`status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='标注任务信息';

/*Data for the table `data_task` */

/*Table structure for table `dict` */

DROP TABLE IF EXISTS `dict`;

CREATE TABLE `dict` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `remark` varchar(255) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8;

/*Data for the table `dict` */


/*Table structure for table `dict_detail` */

DROP TABLE IF EXISTS `dict_detail`;

CREATE TABLE `dict_detail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `dict_id` bigint(20) DEFAULT NULL,
  `label` varchar(255) NOT NULL,
  `value` varchar(255) NOT NULL,
  `sort` bigint(20) DEFAULT '999',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=144 DEFAULT CHARSET=utf8;

/*Data for the table `dict_detail` */


/*Table structure for table `menu` */

DROP TABLE IF EXISTS `menu`;

CREATE TABLE `menu` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `pid` bigint(20) NOT NULL DEFAULT '0' COMMENT '上级菜单ID',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '菜单类型: 0目录，1页面，2权限，3外链',
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `icon` varchar(255) DEFAULT NULL COMMENT '菜单图标',
  `path` varchar(255) DEFAULT NULL COMMENT '路径或外链URL',
  `component` varchar(255) DEFAULT NULL COMMENT '组件路径',
  `component_name` varchar(255) DEFAULT NULL COMMENT '路由名称',
  `layout` varchar(255) DEFAULT NULL COMMENT '页面布局类型',
  `permission` varchar(255) DEFAULT NULL COMMENT '权限标识',
  `back_to` varchar(255) DEFAULT NULL COMMENT '上级菜单',
  `ext_config` varchar(255) DEFAULT NULL COMMENT '扩展配置',
  `hidden` bit(1) DEFAULT b'0' COMMENT '菜单栏不显示',
  `cache` bit(1) DEFAULT b'0' COMMENT '路由缓存 keep-alive',
  `sort` bigint(20) DEFAULT '999' COMMENT '菜单排序',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建人id',
  `update_user_id` bigint(20) DEFAULT NULL COMMENT '修改人id',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `deleted` bit(1) DEFAULT b'0' COMMENT '删除标记 0正常，1已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1101 DEFAULT CHARSET=utf8;

/*Data for the table `menu` */


